import React from "react";
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
import "./index.css";

function Note(props){
    return (
        <div className="all-notes">
          <div className="myNote">
          <h3>{props.title}</h3>
          <p>{props.conten}</p>
          <button className="deletebtn">
              <DeleteOutlineIcon className="delete"/>
          </button>
        </div>
        </div>
    );
}
export default Note;
